import React from 'react';
import './App.css';

function App() {
  const Feeds = () => {
    const getfeeds = fetch('http://127.0.0.1:5002/api/v1/feeds')
    .then(response => response.json())
    .then(data => console.log(data?.data))

    return getfeeds
  }
  return (
    <div className="App">
      <div>{Feeds.map((feed: any) => feed)}</div>
    </div>
  );
}

export default App;
